import React,{ useState } from 'react';
import { GrobalStyle } from './styles.GlobalStyles';

const Test = () => {
  let pk;
  if(pk) {
    return (
      <h1>Triple cork!!!</h1>
    );
  } else {
    return (
      <h1>Double Half XD</h1>
    );
  }
}



const App = () => {
  const [count,setCount] = useState(true);
  return (
    <div>
      <GrobalStyle />
      <Test />
      <button onClick = {() => setCount(!count)}></button>
    </div>
  );
};



export default App;
